import { useHistory } from "react-router"

const Login = () => {
    const history = useHistory()

    return(
        <div>
            <input type='text' />
            <input type='text' />
            <button onClick = {() => {history.push('/user/manager')}}>login</button>
        </div>
    )
}

export default Login
